// App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from './components/Navbar';
import ProductCard from './components/ProductCard';
import CartPage from './components/CartPage';
import About from './components/About'; // Компонент "О нас"
import './App.css'; // Подключаем стили

const App = () => {
    const products = [
        { id: 1, name: 'Product 1', price: 100, image: 'https://via.placeholder.com/150' },
        { id: 2, name: 'Product 2', price: 200, image: 'https://via.placeholder.com/150' },
        { id: 3, name: 'Product 3', price: 300, image: 'https://via.placeholder.com/150' },
    ];

    return (
        <Router>
            <Navbar />
            <Routes>
                <Route path="/" element={
                    <div className="container">
                        <h2>Our Products</h2>
                        <div className="product-list">
                            {products.map(product => <ProductCard key={product.id} product={product} />)}
                        </div>
                        <About /> {/* Блок "О нас" */}
                        <div className="map">
                            {/* Вставляем карту через iframe */}
                            <iframe
                                src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d254574.0863941653!2d-73.98352296399997!3d40.72815709999999!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x89c25a2fa1d7c4bf%3A0xac62b597cb3edb90!2sNew%20York%2C%20NY%2C%20USA!5e0!3m2!1sen!2sru!4v1637233485759!5m2!1sen!2sru"
                                width="600" 
                                height="450" 
                                style={{ border: 0 }} 
                                allowFullScreen="" 
                                loading="lazy"
                            ></iframe>
                        </div>
                    </div>
                } />
                <Route path="/cart" element={<CartPage />} />
            </Routes>
        </Router>
    );
};

export default App;
